import React from 'react';
import PostItem from './PostItem';
import './post.css';

const Posts = ({ blogs }) => {
  return (
    <div className='blogList-wrap'>
      {blogs.map((blog) => (
        <PostItem blog={blog} />
      ))}
    </div>
  );
};

export default Posts;
